import { Container, Row, Col, Button } from 'react-bootstrap';

const userProfileData = {
  name: "John Doe",
  email: "johndoe@example.com",
  createdOn: "01/01/2022",
  imageSrc: "https://via.placeholder.com/150",
};

const UserProfile = () => {
  return (
    <Container className="mt-5">
      <Row>
        <Col md={3}>
          <img src={userProfileData.imageSrc} alt="User Profile" className="img-fluid rounded-circle" />
          <Button variant="primary" className="w-100 mt-3">Logout</Button>
          <Button variant="outline-primary" className="w-100 mt-3">Forgot Password</Button>
        </Col>
        <Col md={9}>
          <h2>{userProfileData.name}</h2>
          <p>{userProfileData.email}</p>
          <p>Joined on {userProfileData.createdOn}</p>
        </Col>
      </Row>
    </Container>
  );
}

export default UserProfile;
